import React, { useState } from 'react'
import ChildDataEmployee from './ChildDataEmployee'

const GetData =(props)=>{
    const [data, setData] = useState([
        { firstName: 'pasya', lastName: 'winda', pekerjaan: 'Web Developer', status: 'Single' },
        { firstName: 'john', lastName: 'doe', pekerjaan: 'Web Developer', status: 'Married' },
        { firstName: 'jane', lastName: 'doe', pekerjaan: 'Designer', status: 'Single' }
      ]);
      
    return (
        <div>
         {data.map((item, index) => (
            <ChildDataEmployee key={index}  number={index + 1} />
         ))}
        </div>

    )
}
export default GetData
